import React from "react";
import { BrowserRouter, createBrowserRouter, Route, Routers,RouterProvider } from "react-router-dom";
import Home from "./pages/home/Home";
import Patients from "./pages/patients/Patients";
import Inventory from "./pages/inventory/Inventory";
import New from "./pages/new/New";
import Single from "./pages/single/Single";
import Login from "./pages/login/Login";
import Register from "./pages/register/Register";

function App(){
  <div>
    <BrowserRouter>
    <Routers>

        <Route path="/" element={<Home/>}></Route>,
        <Route path="/" element={<Patients/>}></Route>,
        <Route path="/" element={<Inventory/>}></Route>,
        <Route path="/" element={<Single/>}></Route>,
        <Route path="/" element={<New/>}></Route>,
        <Route path="/" element={<Login/>}></Route>,
        <Route path="/" element={<Register/>}></Route>,
    </Routers>
    </BrowserRouter>
  </div>
};


export default App;
